import React from 'react'
import { LogInStyled } from './logInStyled';
import { connect } from 'react-redux';
import Form from 'react-bootstrap/Form';
import FormControl from 'react-bootstrap/FormControl';
import FormText from 'react-bootstrap/FormText';
import FormGroup from 'react-bootstrap/FormGroup';
import Button from 'react-bootstrap/Button';
import { Link } from 'react-router-dom';

const Login = props => {
    return (
        <LogInStyled themeStyle={props.themeStyle}>
            <h4 className='title text-capitalize mb-4'>log in</h4>
            <div className='login_social text-center mb-4 text-muted'>
                <Button className='social_btn text-capitalize face d-block mb-2 w-100'>Facebook</Button>
                <Button className='social_btn text-capitalize google d-block mb-2 w-100'>Google</Button>
                <span className='small_message'> or log in with</span>
            </div>
            <div className='my_form'>
                <Form>
                    <FormGroup>
                        <FormControl type='text' placeholder='Username' />
                        <FormText className='error_msg_text'>error on Text</FormText>
                    </FormGroup>
                    <FormGroup>
                        <FormControl type='password' placeholder='Password' />
                        <FormText className='error_msg_pass'>Error on Passowrd</FormText>
                    </FormGroup>
                </Form>
            </div>
            <div className='dont_have_account mt-5 text-center'>
                <p>Don't have account <Link to=''>Sign up</Link></p>
            </div>
        </LogInStyled>
    )
}

const mapStateToProps = state => ({
    themeStyle: state.theme.themeStyle
})

export default connect(mapStateToProps)(Login);
